export default function About() {
  function onSubmit(e) {
    e.preventDefault();
    console.log("submitted");
  }

  return (
    <>
      <form onSubmit={onSubmit}>
        <input placeholder="author" />
        <button>Submit</button>
      </form>
    </>
  );
}
